import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <form onSubmit={handleSubmit}>
      <div>
        <input type="text" value = {name} onChange={(e)=>setName(e.target.value)} required>
        </input>
      </div>
      <div></div>
    </form>
  );
};
